import React from "react"

const Foodcard = ({ img, desc, heading, process, ingredients, alt }) => {
  return (
    <div className="foodcard">
      <img src={img} alt={alt} />
      <h1>{heading}</h1>
      <h4>{ingredients}</h4>
      <p>{desc}</p>
      <ul key="">{process}</ul>
    </div>
  )
}
export default Foodcard
